import { techMastered } from "../techs/techMastered.component";

const TechCollection = () => {
  return(
    <div>
      {
        techMastered.map((Tech, index) => {
          return <Tech style={{'width':'480px'}}/>
        })
      }
    </div>
  )
}

export default TechCollection;



